import React, {Component} from 'react';
import { eventNames } from 'cluster';

class formulario extends Component{
    constructor(props){
        super(props);
        this.state={
            nombre: '',
            apellido: '',
            correo: '',
            contraseña: '',
            rcontraseña:''
        };
        this.handleInputChange = this.handleInputChange.bind(this);
    }

/*        this.state={value: ' '};
        this.state.nombre={value: ' '};
        this.state.apellido={value: ' '};
        this.state.correo={value: ' '};
        this.state.contraseña={value: ' '};        
        this.state.rcontraseña={value: ' '};  
*/    


        handleInputChange(event) {
            const target = event.target;
            const value = ' ';
            const name = target.name;

            this.setState({
                [name]: value
            });
        }

/*
        this.handleChange= this.handleChange.bind(this);
        this.handleSubmit= this.handleSubmit.bind(this);

    }
    handleChange(event){
        this.setState({value: event.target.value});
    }
    handleSubmit (event){   
            alert('Envio satisfactorio');
            event.preventDefault();                           
    }  
*/

    render(){
        return(
            <form className="formularios" onSubmit={this.handleSubmit} >  
            <h1>REGISTRO</h1>  
                <label>
                    Nombres: 
                    <input type="text"  required value={this.state.value.nombre} onChange={this.handleInputChange}/>
                </label>  
                <br/>
                <label>
                    Apellido: 
                    <input type="text"  required value={this.state.value.apellido} onChange={this.handleChange.apellido}/>
                </label> 
                <br/>
                <label>
                    Correo:
                    <input type="email"  required value={this.state.value.correo} onChange={this.handleChange.correo}/>
                </label> 
                <br/>
                <label>
                    Contraseña: 
                    <input  type="password"  required value={this.state.value.contraseña} onChange={this.handleChange.contraseña}/>
                </label>  
                <br/>
                <label>
                    Confirmar contraseña: 
                    <input type="password" required value={this.state.value.rcontraseña} onChange={this.handleChange.rcontraseña} />
                </label>               
                <br/>
                <input type="submit" value="Enviar" />  

          </form>       
        );
    }
}
export default formulario;
